CREATE TABLE IF NOT EXISTS knjige(
    id  INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
   ,področje   INTEGER
  ,podpodročje INTEGER  
  ,naslov      VARCHAR(91) NOT NULL
  ,avtor       VARCHAR(38)
  ,pozicija    INTEGER 
  ,jezik       INTEGER 
  ,zbirka      VARCHAR(28)
  ,država      VARCHAR(26)
  ,LETO        INTEGER 
);

